import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import {
    Home,
    LoginPage,
    AfterLogin,
    NoMatch,
    Navbar,
  } from './pages';

function CustomRoutes() {

return ( 
    <Router>

    {/* <section className="App"> */}
    <Routes className="content">
        <Route element={<Navbar/>}/>
          <Route exact path="/">
            <Home />
          </Route>
          <Route path="/home">
            <Home />
          </Route>
          <Route path="/login">
            <LoginPage />
          </Route>
          <Route path="/loggedIn">
            <AfterLogin />
          </Route>
          <Route path="*">
            <NoMatch />
          </Route>
    </Routes>
    {/* </section> */}
  </Router>
);
}

export default CustomRoutes;
